import React,{useEffect,useState} from 'react';
import axios from 'axios';
import { Socialmedia, Socialicon, Socialp, Socialinfo, Face, Twitter, Pin } from './style.js';
const SocailMedia = () => {
    
        const [social, setSocail] = useState([])
        useEffect(() => {
            axios.get('js/data.json').then(res => { setSocail(res.data.social) })
            
        }, []);
            
        const SocailList = social.map((item) => {
            return (
                <>
                    <Socialicon className="icon fa fa-facebook fa-lg" />
                    <Socialp>
                        <span className="info1">Follow Me on</span>
                        <Socialinfo>Social Facebook</Socialinfo>
                    </Socialp>
                </>
            );
        });
    
        return (
            <Socialmedia>
      {SocailList}
            </Socialmedia>
        );
    };

export default SocailMedia;
